class Productorder {
  Productorder({
    num? id,
    String? uniqueid,
    String? sku,
    String? name,
    dynamic imeiHs,
    String? image,
    num? quantity,
    num? price,
    num? capacity,
    String? model,
  }) {
    _id = id;
    _uniqueid = uniqueid;
    _sku = sku;
    _name = name;
    _imeiHs = imeiHs;
    _image = image;
    _quantity = quantity;
    _price = price;
    _capacity = capacity;
    _model = model;
  }

  Productorder.fromJson(dynamic json) {
    _id = json['id'];
    _uniqueid = json['uniqueid'];
    _sku = json['sku'];
    _name = json['name'];
    _imeiHs = json['imei_hs'];
    _image = json['image'];
    _quantity = json['quantity'];
    _price = json['price'];
    _capacity = json['capacity'];
    _model = json['model'];
  }

  num? _id;
  String? _uniqueid;
  String? _sku;
  String? _name;
  dynamic _imeiHs;
  String? _image;
  num? _quantity;
  num? _price;
  num? _capacity;
  String? _model;

  Productorder copyWith({
    num? id,
    String? uniqueid,
    String? sku,
    String? name,
    dynamic imeiHs,
    String? image,
    num? quantity,
    num? price,
    num? capacity,
    String? model,
  }) =>
      Productorder(
        id: id ?? _id,
        uniqueid: uniqueid ?? _uniqueid,
        sku: sku ?? _sku,
        name: name ?? _name,
        imeiHs: imeiHs ?? _imeiHs,
        image: image ?? _image,
        quantity: quantity ?? _quantity,
        price: price ?? _price,
        capacity: capacity ?? _capacity,
        model: model ?? _model,
      );

  num? get id => _id;

  String? get uniqueid => _uniqueid;

  String? get sku => _sku;

  String? get name => _name;

  dynamic get imeiHs => _imeiHs;

  String? get image => _image;

  num? get quantity => _quantity;

  num? get price => _price;

  num? get capacity => _capacity;

  String? get model => _model;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['uniqueid'] = _uniqueid;
    map['sku'] = _sku;
    map['name'] = _name;
    map['imei_hs'] = _imeiHs;
    map['image'] = _image;
    map['quantity'] = _quantity;
    map['price'] = _price;
    map['capacity'] = _capacity;
    map['model'] = _model;
    return map;
  }
}

List<MModel> mModelFromJson(String str) {
  try {
    return List<MModel>.from(json.decode(str).map((x) => MModel.fromJson(x)));
  } catch (_) {
    return [];
  }
}
